                 backgroundImage: `url(${aBackground})`,
                 backgroundRepeat: "no-repeat",
                 backgroundPosition: "center",
                 backgroundSize: "cover",
                 display:"inline-block"
             }}
         >
           <h2>{name}</h2> 
         </div>

    );
 }

 export default Label;
